// Dilansir dari detikSport, juara Liga Champions ini adalah titel pertama dalam sejarah Man City. Kesuksesan ini praktis melengkapi kesuksesan Erling Haaland dkk di sepanjang musim ini setelah memenangi Premier League dan Piala FA.

