// Mereka adalah Celtic (1966/67), Ajax (1971/72), PSV (1987/88), Manchester United (1998/99), Barcelona (2008/09, 2014/15), Inter (2009/10), Bayern (2012/13, 2019/20), dan terakhir Manchester City di 2022/23.

