// Prestasi Manchester City

// Selama berdiri hingga saat ini sudah ada 28 trofi yang diperoleh Manchester City.

// 28 Trofi itu diperoleh dari berbagai ajang pertandingan dari Premeie League hingga Piala Winners.

// Pertama pada ajang Premier League Manchester City berhasil membawa pulang piala sebayak tujuh buah.

// Semua trofi itu didapat pada musim 1936/1937, 1967/1968, 2011/2012, 2013/2014, 2017/2018, 2018/2019, dan 2020/2021.

