// Sejarah Manchester City

// Manchester City adalah klub bola yang terbentuk pada 1 Januari 1880, yang ternyata dalam proses berdirinya ada peran seorang perempuan.

// Klub bola ini muncul berawal dari diangkatnya Arthur Connell sebagai Kepala Gereja St.Mark's di West Gorton, yang merupakan sebuah distrik di timur Manchester, Inggris.

// Terbentuknya klub ini bukan atas peran Arthur, namun ide putrinya yaitu Anna Connell yang membentuk sebuah asosissi bagi pemuda paroki.

// Baca Juga: Profil Jesse Lingard, Pemain Sepak Bola Andalan Inggris di Piala Dunia

// Anna, ingin para pemuda paroki memiliki kegiatan yang membuatnya berolahraga.

// Menurutnya, olahraga bisa menjadi cara menyatukan dan mengurangi kejahatan yang saat itu banyak terjadi di timur Manchester.

// Dari ide itu, pada tahun 1868 terbentuk Tim Kriket Gereja St.Mark's dan pada tahun 1875, tim kriket menambahkan permainan sepak bola di dalamnya.

// Saat itu, permainan sepak bola telah populer dan banyak diminati masyarakat.

// Lalu pada tahun 1880 pemain kriket resmi membuat sebuat tim sepak bola dengan nama St.Mark's dan dimpimpin oleh William Beastow dan Anna Connell.

// Anna Connell pun dikenal menjadi satu-satunya perempuan yang pernah berperan dalam proses terbentuknya sebuah tim sepak bola yang saat itu dimainkan laki-laki.

// Pada tahun 1887, tim tersebut pun pindah ke tempat baru yang ada di Hyde Road, Ardwick.

// Dengan pindahnya markas klub, nama pun turut berubah menjadi Ardwick A.F.C guna menyesuaikan dengan tempat baru.

// Klub tersebut mulai berkompetsi di divisi 2 Football League pada tahun 1892.

// Namun sayangnya, klub ini mengalami masalah keuangan pada tahun 1893 hingga 1894.

// Karena masalah itu, klub bola ini mengalami penyususnan organisasi ulang dan kembali berganti nama menjadi Manchester City Football Club.

